Step-by-step reasoning:
1. The key psychological mechanism for proposers is the trade‐off between fairness and self‐interest. Proposers are expected to consider what would be fair given the contributions (token_self and token_opp) while also possibly shifting the offer in their favor.
2. Since each token corresponds to a monetary value, a normative fairness expectation can be computed by treating the opponent’s tokens as a fraction of the total tokens multiplied by 100 (i.e. a percentage). Proposers may deviate from this normative fair offer owing to a bias toward lower giving (or, less commonly, generosity).
3. To capture these considerations, the model uses a quadratic penalty function that computes the “cost” (negative utility) associated with deviating from a fairness norm that is shifted by a bias term.
4. The mathematical form is therefore:
  U = – alpha · (proposed_perc – (100 * token_opp / (token_self + token_opp) + delta))²
 where:
 • proposed_perc is the percentage proposed to the opponent (the action being evaluated),
 • token_self and token_opp enter to form the fairness norm,
 • delta is a bias parameter representing systematic deviations from normatively fair behavior,
 • alpha is a sensitivity parameter that weights the penalty.
5. The model thus maps observable behavior (i.e. the observed proposed_perc on proposer trials) to utility, whereby the highest (least negative) utility is achieved when the proposal matches the biased fairness norm. This model makes predictions for only proposer behavior and avoids incorporating utility for the alternative (reject) action.

The formal model specification, learnable parameters (alpha and delta), and variable descriptions are provided below.

